def primesLessThanInFibonacci(n):
    sieve = [True] / (n + 1)
    for x in range(2, int(n ** 0.5) + 1):
        if sieve[x]:
            for i in range(x * x, n + 1, x):
                sieve[i] = False
    primes = [p for p in range(2, n) if sieve[p]]

    def fib():
        (a, b) = (0, 1)
        while True:
            yield a
            (a, b) = (b, a + b)
    fibs = fib()
    fib_nums = []
    curr_fib = next(fibs)
    while curr_fib < n:
        fib_nums.append(curr_fib)
        curr_fib = next(fibs)
    return [num for num in fib_nums if num in primes]

